import React, { Component } from 'react';

class Footer extends Component {
    render() {
        return (
            <div className="App Site">
                <div className="Site-content">
                    <div className="App-header">
                    </div>
                    <div className="main">
                    </div>
                </div>
                <Footer />
            </div>
        );
    }
}

export default Footer;
